import React from "react";
import Product from "./product.js";

export default function Body() {
  let prod;
  fetch("./data/prodet.json")
    .then((res) => res.json())
    .then((data) => {
      prod = data;
    });

  const productComponents = prod.map((prod) => {
    <Product key={prod.id} name={prod.name} details={prod.det} />;
  });

  return <div>{prod.name}</div>;
}
